			shellPath = /bin/sh;
			shellScript = "# xcodebuild -scheme BuildFatFramework -workspace MyFramework.xcworkspace build\n# 1\n# Set bash script to exit immediately if any commands fail.\nset -e\n# 2\n# Setup some constants for use later on.\nFRAMEWORK_NAME=\"${PROJECT}\"\nFRAMEWORK_PATH=\"${SRCROOT}/Frameworks\"\nOUTPUT_DIR=\"${SRCROOT}/build\"\n# 3\n# If remnants from a previous build exist, delete them.\nif [ -d \"${OUTPUT_DIR}\" ]; then\nrm -rf \"${OUTPUT_DIR}\"\nfi\n# 4\n# Build the framework for device and for simulator (using\n# all needed architectures).\nif [ -d \"${FRAMEWORK_NAME}.workspace\" ]; then\nxcodebuild -workspace \"${FRAMEWORK_NAME}.workspace\" -scheme \"${FRAMEWORK_NAME}\" -configuration Release -arch=\"$(ARCHS_STANDARD)\" only_active_arch=no defines_module=yes -sdk \"iphoneos\" -derivedDataPath \"${OUTPUT_DIR}\"\nxcodebuild -workspace \"${FRAMEWORK_NAME}.workspace\" -scheme \"${FRAMEWORK_NAME}\" -configuration Release -arch=\"$(ARCHS_STANDARD)\" only_active_arch=no defines_module=yes -sdk \"iphonesimulator\" -derivedDataPath \"${OUTPUT_DIR}\"\nelse\nif [ -d \"${FRAMEWORK_NAME}.xcodeproj\" ]; then\nxcodebuild -project \"${FRAMEWORK_NAME}.xcodeproj\" -scheme \"${FRAMEWORK_NAME}\" -configuration Release -arch=\"$(ARCHS_STANDARD)\" only_active_arch=no defines_module=yes -sdk \"iphoneos\" -derivedDataPath \"${OUTPUT_DIR}\"\nxcodebuild -project \"${FRAMEWORK_NAME}.xcodeproj\" -scheme \"${FRAMEWORK_NAME}\" -configuration Release -arch=\"$(ARCHS_STANDARD)\" only_active_arch=no defines_module=yes -sdk \"iphonesimulator\" -derivedDataPath \"${OUTPUT_DIR}\"\nfi\nfi\necho \"Creating ${FRAMEWORK_PATH}/${FRAMEWORK_NAME}.framework...\"\n# 5\n# Remove .framework file if exists from previous run.\nif [ -d \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework\"\nfi\n# 6\n# Copy the device version of framework.\ncp -r \"${OUTPUT_DIR}/Build/Products/Release-iphoneos/${FRAMEWORK_NAME}.framework\" \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework\"\n# 7\n# Replace the framework executable within the framework with\n# a new version created by merging the device and simulator\n# frameworks' executables with lipo.\nlipo -create -output \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${OUTPUT_DIR}/Build/Products/Release-iphoneos/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${OUTPUT_DIR}/Build/Products/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n# 8\n# Copy the Swift module mappings for the simulator into the\n# framework. The device mappings already exist from step 6.\ncp -r \"${OUTPUT_DIR}/Build/Products/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule/\" \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule\"\n# 9\n# Copy the Swift _CodeSignature for the simulator into the\n# framework. The _CodeSignature already exist from step 6.\ncp -r \"${OUTPUT_DIR}/Build/Products/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/_CodeSignature\" \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework/_CodeSignature\"\n# 10\n# Move framework from the build folder to a Framework folder.\nrm -rf \"${FRAMEWORK_PATH}\"\nmkdir \"${FRAMEWORK_PATH}\"\n\ncp -r \"${OUTPUT_DIR}/${FRAMEWORK_NAME}.framework\" \"${FRAMEWORK_PATH}/${FRAMEWORK_NAME}.framework\"\n# 11\n# Remove .framework file if exists from previous run.\nif [ -d \"${OUTPUT_DIR}\" ]; then\necho \"Cleaning up...\"\nrm -rf \"${OUTPUT_DIR}\"\nfi\necho \"Done\"\n";
